script: |
  super -f text -I q1519.spq | sort > q1519.out

inputs:
  - name: q1519.spq
    data: |
      SELECT + - col0 + + + ( - col0 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 * - + col1 NOT BETWEEN - 2 * ( + + CAST ( 20 AS INTEGER ) ) AND - col2 * - + 69;
  - name: tab2

outputs:
  - name: q1519.out
    data: |
